import React from "react";
import client from "../contentful";
import foodPost from "../components/foodPost";

const Home = () => {
  const [posts, setPosts] = React.useState(null);

  React.useEffect(() => {
    client
      .getEntries({
        content_type: "food",
      })
      .then((entries) => {
        setPosts(entries.items);
      });
  }, []);

  return (
    posts &&
    posts.map((post, i) => {
      return <foodPost>HEJ</foodPost>;
    })
  );
};

export default Home;
